{"post_stream":{"posts":[{"id":3335305,"name":"Caden Feller","username":"BlackDiamond","avatar_template":"/user_avatar/www.chiefdelphi.com/blackdiamond/{size}/165070_2.png","created_at":"2024-03-17T19:49:17.089Z","cooked":"<p>Hello!</p>
<p>My name is Caden, I am the lead programmer on team FYRE 5480. We are currently using an encoder for our intake. It is this encoder kit. We wired it up and it worked for a while, but after a recent power-on, it stopped giving us a value. No code (to my knowledge) has been changed, nor has the wiring. Details about our current configuration and debugging will be listed below. Any help would be greatly appreciated. Thanks.</p>
<p>Current wiring Configuration:</p>
<p>quadrature output port on the encoder board.<br>
<span class="abbreviation">PWM<template class="tooltiptext" data-text="Pulse Width Modulation"></template></span> wire 1 - DIO port 0</p>
<p>Brown to black<br>
Orange to red<br>
Yellow to white</p>
<p><span class="abbreviation">PWM<template class="tooltiptext" data-text="Pulse Width Modulation"></template></span> wire 2 - DIO port 1</p>
<p>Blue to white</p>
<p>Both <span class="abbreviation">PWM<template class="tooltiptext" data-text="Pulse Width Modulation"></template></span> wires are fully seated in the DIO pins on the roboRIO for their respective ports, with the white wires facing inward (closest to the DIO letters on the roboRIO)</p>
<p>Current programming Configuration:</p>
<p>in our intake subsystem:</p>
<pre><code class="lang-auto">// The encoder for the intake actuation.
private final Encoder intakeEncoder = new Encoder(
    IntakeConstants.intakeEncoderA,
    IntakeConstants.intakeEncoderB,
    false, 
    Encoder.EncodingType.k4X
);

/**
 * Returns the position of the intake encoder.

 * @return - The integer value of the rotational position of the encoder.
 */
public double getEncoderDistance() {
    return intakeEncoder.getDistance();
}

@Override
public void periodic() {
    System.out.println(intakeEncoder.getDistance()); // &amp;lt;-- this spams "0.0"
}
</code></pre>
<p>in our constants file</p>
<pre><code class="lang-auto">// ENCODER VALUES //

// The a channel of the intake encoder
public static final int intakeEncoderA = 0;

// The b channel of the intake encoder
public static final int intakeEncoderB = 1;
</code></pre>
